@maribst Hi Mari
If the issue is not solved you can also contact us on live chat or messenger https://t.co/b3QIqPBI2R
Kind regards /Anna

@michjnich Hi Michael
If you have any documents to register and have not registered them already on https://t.co/npOCZJZska you can do it at check in on airport. It can take some time if the queue is long so be there in very good time. 

Best regards /Anna

@himmiparis Hello
You can contact us by phone, live chat https://t.co/b3QIqPBI2R or messenger. Contact information is by the link i sent.
Kind regards/Anna

@theis_schaefer Hi Theis
You can not earn points or flights on a bonusticket. But you can earn on a regular ticket partly paid with points (points + money).

Kind regrads/Anna

@ProfPHansen Hi Peter
Unfortunately we can not assist with bookings that is not our own, if it is purchased via another agent it needs to be handled by them.
Kind regards /Anna

@hannahamie Hello
Please contact us on live chat , phone https://t.co/b3QIqPBI2R or Face book messenger and we can help you further with this.

Kind regards /Anna

@castefish Hello Edwin
Here is our phone list of contacts https://t.co/b3QIqPBI2R

Kind regards/Anna

@rebeccabreene Hi, I'm sorry to hear that your flights were rescheduled and we understand that it causes complications and frustration. If your new departure is not optimal for you, please contact us on the phone for assistance with rebooking https://t.co/b3QIqPBI2R

Best regards,
Anton.

@jgilling31 Hej, vänligen kontakta oss på live-chatt https://t.co/RDEH7uxbwJ med ditt case ID så kanske vi kan prova sända en påminnelse till Customer Care gällande ditt ärende därifrån.

Med vänlig hälsning,
Anton.

@chrysagolf Hi, we have a live-chat option at https://t.co/b3QIqPk7bj - on the chat we can help with general info and easier support questions. If you received a schedule change of your reservation we ask you to contact us by phone.

Best regards,
Anton.

@MadsTheisen Hello, at the moment there may be longer wait times than usual when contacting customer service and we apologize for this. Please hold and you will be connected to an agent as soon as possible.

Best regards,
Anton.

@Alex_H_Griffin Hi, I am sorry to hear that the baggage was lost during transportation. If you haven't already, please register a delayed baggage report at https://t.co/ojhL9dIf2x and Baggage Service will contact you as soon as they have located the baggage.

Best regards,
Anton.

@RLewisTeacher Hi, we apologize for the longer than average wait times on our phone line currently. We are working as fast as possible to take your call.

Best regards,
Anton.

@Alias7379 Hi! 

Unfortunately, we have no opportunity to call you. Please stay on the phone and we will answer your call as soon as we can.

Kind Regards, Jennie

@souvlodoxos Hello! We are sorry for the inconvenience. If the flight has been cancelled and/or rescheduled from our side, you have the right to rebook or cancel the flight. You can find our contact info here: https://t.co/b3QIqPk7bj and we will help you with that.

Kind regards,
Jenny

@JKaulsen Hi! 

I sadly can't confirm your booking from here but we do have a flight going to Copenhagen from Heathrow tomorrow at that time. Sometimes it's not possible to get the boarding pass online so i recommend that you go to the airport so we can help you.

// Best regards, Dennis.

@Langsund I recommend that you contact us by phone or on our live chat with your case id so that we can check the case. You can find contact details on https://t.co/b3QIqPk7bj

Kind regards,
Philip

@JKaulsen Hi, in that case you might be traveling to a destination which requires covid-19 documents to be approved at the airport before departure. If you cannot download it online please proceed to the airport to retrieve the boarding pass.

Best regards,
Anton.

@Langsund Hi, we are sorry to hear that. Have you opened a compensation claim with our Customer Care department at https://t.co/wprQ9Zejqh ? If not please do so and they will contact you by email as soon as possible regarding this.

Best regards,
Anton.

@LiseOkkels Hi, I recommend that you contact us on live-chat and we can help you change the phone number over there https://t.co/b3QIqPk7bj

Best regards,
Anton.

@MarionJFrance Hi, when rebooked to new alternatives they are planned to have enough connection time for you, if the flight would be delayed causing you to not make it in time for the next flight, they can help you with rebooking at the airport.

Best regards.
Anton.

@ProfPHansen Hi. I'm sorry to hear that your flight was cancelled. Please contact our sales and service support for assistance with finding new alternatives to rebook to. Our phone numbers are located on https://t.co/b3QIqPk7bj

Best regards,
Anton.

@Maryorquin Hi, if you need proof of boarding for documentation reasons after the travel you must save the physical boarding pass, or take a screenshot of the boarding pass if you had a digital one.

Best regards,
Anton.

@SimonHoejbjerg Hej!

Jag beklagar att du upplever det som så, om du vill skicka in en feedback eller ett klagomål så kan du göra det via denna länk: https://t.co/BTF660MMR4

//Vänlig hälsning, Dennis.

@TheSoccerDucks Hi! 

Yes you can change a eurobonus trip as long as you do it at least 1 day before departure of the outbound flight. If you get any problems with it online then i recommend that you call our customer service so we can help you.

//Best regards, Dennis.

@ohmyldn_ Hi, i can not change number here on social media since we can not take booking references. We can change it through our chat or phone support.   https://t.co/b3QIqPk7bj

Regards,
Peter

@noob_fra Hi, as long as it fits within the limits of the hand luggage, 55x40x23cm and 8kg, it is ok to bring it. The security personnel might decide they want to look at it. 

Regards,
Peter

@barnesy5k Hi, I apologize that the communication takes time. I have no insight in the departments that have email contact so I can unfortunately not provide an answer regarding their handling time or workload.

Regards,
Peter

@velde18 Hi, It is decided locally at each airport where they make the document control. It is unfortunately nothing we can provide information about.

Regards,
Peter

@BjorgeStavik Hej, Flygen schemaläggs efter den minimala anslutningstid vi får information om av flygplatserna och det går att flyga på dem. Men om du känner att det blir för lite tid med 30 minuer så boka om möjligt avgångar med lite mer tid mellan flygen. 

Hälsningar,
Peter

@WardJoosten Hi, We at customer service have unfortunately no access to the airports check in. If it is not possible to check in online, you do the check in at the airport when you arrive there.

Regards,
Peter

@eroth40 Hi Erica, We at customer service have no access to baggage services cases or system at the airport. . Please contact baggage service on phone +1 310 417 3615 so they can send the email to you. 

Regards,
Peter

@AikeVisbeek Hi! 

I apologize for the long queue right now, our agents are working on it as fast as possible, but the best we can recommend is to wait a little bit until an agent can answer your call. 

//Best regards, Dennis.

@Jonnyratcliffe1 Hi! 

Yes the time to get a confirmation can vary from flight to flight so it's hard too say exactly. But the best i can recommend is to take your documents with you too the airport if you haven't received a confirmation.

//Best regards, Dennis.

@scottmcc1973 Hi! 

I apologize for the wait, there is sadly a few bookings where it's not possible to check in online and receive a boarding pass. If you want to send us a feedback/complaint then you can use this link: https://t.co/BTF660MMR4

//Best regards, Dennis.

@imSankz Hi! 

No Customer Care sadly don't have an email you can use, the only way to get in contact with them is to send them a complaint or compliment via this link: https://t.co/BTF660MMR4

//Best regards, Dennis.

@oletan Hi! 

I apologize that she had an experience like that. If you want to send us a complaint/feedback then you can use this link: https://t.co/BTF660MMR4

//Best regards, Dennis.

@JRetrieving Hi! 

Yes i had a look and i can see that it was changed in early September, you usually receive an email regarding that change. I recommend that you delete this tweet as it shows your son's booking reference if possible.

//Best regards, Dennis.

@JRetrieving Hello
When you receive this message, you will need to check in and present your travel documents at the airport.

Kind regards, Anja!

@dracula70136224 Hello
Please contact us via chat or phone support and we will help you add seat reservations to your booking. You can find our contacts here: https://t.co/b3QIqPk7bj

Kind regards, Anja!

@NadiaRagozhina Hi Nadia,

We follow the recommendations provided by the European Union Aviation Safety Agency, EASA, regarding the usage of medical face masks.

// Natalie

@baltadydensborg Hej, vi beklagar om det inte gick att ladda ner det digitala boardingkortet inför din flygning. I dessa fall behöver man checka in på flygplatsen för att få sitt boardingkort.

Med vänlig hälsning,
Anton.

@Claireissimo Hi, I'm sorry to hear that you are disappointed by this decision - however it is in accordance with the latest recommendations provided by local public health authorities in Scandinavia as well as the European Union Aviation Safety Agency.

Best regards,
Anton.

@van_der_ark Hello, according to the information I have right now there are no direct flights CPH to ABZ for November and December, however we will fly directly again from mid-January 2022 and onward.

Best regards,
Anton.

@julianmediaz Hello, please contact us on live-chat or phone with your booking reference and we can help you send a confirmation of the updated itinerary https://t.co/b3QIqPk7bj

Best regards,
Anton.

@SeftyDaSoundman Hi! All complaint cases are handled by our Customer Care department. You can contact them by opening a claim at https://t.co/OzrIxYNv63

Best regards,
Anton.

@C_Westling Hej! Från och med i måndags 18:e oktober har vi inte längre kvar på ansiktsmask när man flyger inrikes i Sverige/Norge/Danmark eller mellan dessa länder. På övriga internationella resor är det fortsatt krav på ansiktsmask ombord.

Med vänlig hälsning,
Anton.

@BebOoMzz Hello, I want to apologize for the inconvenience.

Please contact our support and we will take a closer look at this. You can find our contact information here: https://t.co/b3QIqPk7bj

Kind regards, Anja!

@eimearkelleher_ Hello! I'm sorry to hear that your flight was rescheduled, if you wish to check for other alternatives please contact our phone support for assistance, phone numbers can be located at https://t.co/b3QIqPk7bj by clicking on "Customer Service / Eurobonus".

Best regards,
Anton.

@SAR_S I'm glad I could help. Have a nice day you too!

Kind regards,
Anton.

@MINOXXXX88 Hello, please contact us on live-chat https://t.co/b3QIqPk7bj with your booking reference and we can help you take a look at this.

Best regards,
Anton.

@Aidhutch Hello, I'm sorry to hear that your flight was cancelled. I hope you were able to find another similar alternative to rebook to over the phone.

Best regards,
Anton.

@GameGabster Hello, this Eurobonus campaign is only applicable for SAS flights, not Star Alliance flights.

Best regards,
Anton.

@SAR_S Hi, pets can be transported in the cargo hold or in the cabin with us during the winter as well, assuming your destination allows pets from your origin/departure city.

Best regards,
Anton.

@vikingen Hello. Please contact our live-chat at https://t.co/b3QIqPk7bj with your case ID and they might be able to send a reminder to Customer Care about your case.

Best regards,
Anton.

@GregMurray_ Hi, unfortunately we don't have insight into specific bookings here on Twitter. I recommend that you contact our live-chat support at https://t.co/b3QIqPk7bj if you need information about your upcoming flight.

Best regards,
Anton.

@joosttadema Hi, yes all SAS flights flown between October 2021 and January 2022 will yield x4 points and qualified flights to your Eurobonus.

Best regards,
Anton.

@telsaelectrical Hello! Please contact us via live-chat with your Eurobonus number so we can help you take a look at this https://t.co/b3QIqPk7bj

Best regards,
Anton.

@MiiguelCastilla Hello. Lithium battery powered vehicles such as electric scooters can not be transported with SAS passenger flights due to the associated fire risk. We recommend that you send your electrical scooter as cargo with a shipping company instead.

Best regards,
Anton.

@SAR_S Hi, sadly it is not possible to check this in advance but all our tickets have 24 hour full refund guarantee so if it turns out that there is no space left to reserve for your pet, you can cancel the ticket for a full refund.

Best regards,
Anton.

@hectorschector Hi, I'm sorry to hear about the rescheduling. Please save any receipts for costs derived from this and after your trip, please request reimbursement/compensation at https://t.co/wprQ9Zejqh and attach your receipts in the claim.

Best regards,
Anton.

@rahaggard Hello, unfortunately it is not allowed to check-in electronics such as laptops and pc monitors when flying with us. In this case I would recommend you look for freight shipping alternatives with a shipping company instead.

Best regards,
Anton.

@DrCAClarke Hi! Unfortunately we are unable to assist with specific cases here over Twitter, we apologize for the longer than usual wait times on the phone line but please hold and you will be connected to an agent as soon as possible.

Best regards,
Anton.

@proteinvetarN Okej jag förstår, vad bra att de hade möjlighet att hjälpa er med avbokning över telefon i alla fall. Ha en fortsatt trevlig helg.

Med vänlig hälsning,
Anton.

@x8Mon Hi! We plan to fly directly between BHX and CPH from March 2022 and onward, these tickets are available on our website.

Best regards,
Anton.

@mr_melero Hello, I'm sorry to hear that your flight was cancelled and we apologize for the longer than usual wait times on our phone line. Please try calling us again for help with rebooking to new alternatives https://t.co/b3QIqPk7bj

Best regards,
Anton.

@JanEinarE Hej! Vad tråkigt att höra att dina flyg blivit försenade/inställda, i händelse av detta har vi möjlighet att omboka dig till nya alternativ utan avgift över telefon +47 21 896 400.

Med vänlig hälsning,
Anton.

@joreilly Hello, please check so that you are not connected to a VPN/Corporate firewall or use web extensions that can block HTTP requests. You can also try clearing cache/cookies in Chrome to see if that helps.

Best regards,
Anton.

@proteinvetarN Hej! Just nu är det många som kontaktar oss och det orsakar tyvärr längre väntetider än vanligt och vi ber om ursäkt för det. För minskad väntetid rekommenderar vi, om möjligt, att man kontaktar oss direkt vid öppning kl 07 vardag eller kl 09 helg.

Med vänlig hälsning,
Anton.

@UmberIrshad Hello, if you were put on hold by an agent they are probably looking for new alternatives to rebook you to. If you still need help with the rebooking please give us another call https://t.co/b3QIqPk7bj

Best regards,
Anton.

@GameGabster Hello, I'm sorry to hear that. Hopefully they will get to your retro registration case very shortly, thank you for your patience.

Best regards,
Anton.

@00sapo Hello
Unfortunately we can not make copy of boarding pass. 
Best regards /Anna

@rachelsnaughton Hi Rachel 
Contact customer service on Facebook messenger , liva chat or phone https://t.co/b3QIqPk7bj and we can help you further.
Kind regards /Anna

@bjornmellquist Hej Bjorn 
Det går inte att betala med poäng, du kan boka bagage via https://t.co/oQCpCOljhI , telefon 0770 727 727 eller på flygplats. (Rekommenderar dig att inte ange bokningsreferens offentligt , skriv hellre på FB messenger till oss)
Med vänliga hälsningar /Anna

@shakermaker90s Hi Pauly
We do not support instagram so if you need support from us please contact us on Facebook messenger, Twitter, live chat or phone https://t.co/b3QIqPk7bj

Kind regards /Anna

@Quak3r72 Hi! You need to ensure that you are following the rules set for flying into the country https://t.co/YhT9mVc7De
Once you have all the documentation, you can check in at the airport. Be mindful that it might take longer to process due to current restrictions
Kind regards, Rebecka

@tatewu1 Hi, the SK932 was cancelled. If you did not receive an alternative for your flight, please contact us by phone so we can assist you. https://t.co/b3QIqPk7bj 
If you wish to claim compensation you can do so here: https://t.co/OzrIxYNv63
Kind regards, Rebecka
